function displayData(dataArray) {
    const container = document.getElementById('content');
    dataArray.forEach(item => {
        item.results.predictions.forEach(prediction => {
            prediction.models.prosody.grouped_predictions.forEach(group => {
                group.predictions.forEach((entry, index) => {
                    const segmentDiv = document.createElement('div');
                    segmentDiv.classList.add('segment');
                    segmentDiv.innerHTML = `
                        <div class="time">Time: ${entry.time.begin} - ${entry.time.end}</div>
                        <div class="text">Text: ${entry.text}</div>
                        <div class="emotions">Emotions: ${entry.emotions.map(e => `${e.name} (${e.score.toFixed(2)})`).join(', ')}</div>
                    `;
                    container.appendChild(segmentDiv);
                });
            });
        });
    });
}

displayData(dataArray);
